import React from "react";
import { AppBar, Toolbar, Typography, Button, Grid, Card, CardMedia, CardContent, CardActions, Container } from "@mui/material";
import FastfoodIcon from "@mui/icons-material/Fastfood";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import MenuBookIcon from "@mui/icons-material/MenuBook";
import AccountCircleIcon from "@mui/icons-material/AccountCircle";
import AccessTimeIcon from "@mui/icons-material/AccessTime";

const foods = [
  {
    id: 1,
    name: "Cheese Burger",
    description: "Juicy grilled burger with melted cheese and fresh veggies.",
    price: "₹150",
    image: "https://images.unsplash.com/photo-1550547660-d9450f859349",
    time: "20-25 min"
  },
  {
    id: 2,
    name: "Margherita Pizza",
    description: "Classic Italian pizza with fresh tomatoes and mozzarella.",
    price: "₹300",
    image: "https://images.unsplash.com/photo-1601924573311-003d15d646dc",
    time: "25-30 min"
  },
  {
    id: 3,
    name: "Pasta Alfredo",
    description: "Creamy Alfredo pasta topped with fresh herbs.",
    price: "₹250",
    image: "https://images.unsplash.com/photo-1617196034905-1b87aeec5b9c",
    time: "15-20 min"
  }
];

export default function Home() {
  return (
    <>
      {/* Navbar */}
      <AppBar position="static" color="primary">
        <Toolbar>
          <FastfoodIcon sx={{ mr: 2 }} />
          <Typography variant="h6" sx={{ flexGrow: 1 }}>
            Foodie App
          </Typography>
          <Button color="inherit" startIcon={<MenuBookIcon />}>Menu</Button>
          <Button color="inherit" startIcon={<ShoppingCartIcon />}>Orders</Button>
          <Button color="inherit" startIcon={<ShoppingCartIcon />}>Cart</Button>
          <Button color="inherit" startIcon={<AccountCircleIcon />}>Profile</Button>
        </Toolbar>
      </AppBar>

      {/* Food Items */}
      <Container sx={{ py: 4 }}>
        <Grid container spacing={3}>
          {foods.map((food) => (
            <Grid item xs={12} sm={6} md={4} key={food.id}>
              <Card sx={{ height: "100%", display: "flex", flexDirection: "column" }}>
                <CardMedia
                  component="img"
                  height="200"
                  image={food.image}
                  alt={food.name}
                />
                <CardContent>
                  <Typography variant="h6" gutterBottom>
                    {food.name}
                  </Typography>
                  <Typography variant="body2" color="text.secondary">
                    {food.description}
                  </Typography>
                  <Typography variant="subtitle1" sx={{ mt: 1 }}>
                    {food.price}
                  </Typography>
                  <Typography variant="body2" color="primary" sx={{ display: "flex", alignItems: "center", mt: 1 }}>
                    <AccessTimeIcon fontSize="small" sx={{ mr: 0.5 }} /> {food.time}
                  </Typography>
                </CardContent>
                <CardActions>
                  <Button variant="contained" color="success" fullWidth>
                    Order Now
                  </Button>
                </CardActions>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Container>
    </>
  );
}
